import {
  Stack,
  Drawer,
  AppBar,
  Toolbar,
  IconButton
} from "@mui/material";
import {
  Menu
 } from '@mui/icons-material';

 import {
   useState
 } from 'react';
const Admin = ()=>{

  const[width,setWidth] = useState(250);
  const design = (
    <>
      <h1>Helo</h1>
      <Stack>
        <Drawer variant="permanent"
        sx={{
          width:width,
          "& .MuiDrawer-paper":{
            width: width,
            bgcolor: "#f5f5f5"
          }
        }}
        >
        </Drawer>
        <AppBar position="fixed"
          sx={{
            width:`calc(100% - ${width}px)`
          }}
        >
                <Toolbar>
                  <IconButton sx={{color:"inherit"}} onClick={()=>{alert()}}>
                    <Menu />
                  </IconButton>
                </Toolbar>
       </AppBar>
      </Stack>
    </>
  );
  return design;
}
export default Admin;
